function MonthArrow(props) {

    let newYear = props.day.year;
    let newMonth = props.day.month + 1;
    let newDay = props.day.number;

    let newDate = new Date(newYear, newMonth, newDay);

    return (
        <div onClick={() => props.changeCurrentDay(newDate)}>
            <p>&lt;</p>
        </div>
    );
}

